"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\">This tool allows you to </span><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt; font-weight:600;\">rename layers</span><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\"> quickly and flexibly, through a set of combined operations. </span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\">It is particularly useful for:</span></p>\n"
"<ul style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;\"><li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Standardizing layer names before export or sharing</li>\n"
"<li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Removing unwanted characters from names</li>\n"
"<li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Adding prefixes, suffixes, or custom identifiers</li>\n"
"<li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Applying text replacements (find/replace)</li></ul>\n"
"<h4 style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt; font-weight:600;\">⚙️ Main Features:</span></h4>\n"
