"<li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Configure advanced options (case-sensitive)</li>\n"
"<li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">(Optional) Enable geometry comparison:</li>\n"
"<ul style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 2;\"><li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Set desired tolerance</li>\n"
"<li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Choose appropriate spatial relation</li></ul>\n"
"<li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Click &quot;Start Feature Analysis&quot; to begin</li>\n"
"<li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">In the result table, select features to delete</li>\n"
"<li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Use buttons to filter, export, or view features</li>\n"
"<li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Confirm deletion</li></ol>\n"
"<p style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt; font-weight:600;\">💡 Tips:</span></p>\n"
"<ul style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;\"><li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Use tolerance &gt; 0 only when flexible geometry comparison is required</li>\n"
"<li style=\" font-family:\'MS Shell Dlg 2\'; font-size:7.8pt;\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">&quot;Intersects&quot; relation is useful for intersecting lines</li>\n"
